result:
.collapse-title {
  flex: 1 0 90%;
  order: 1;
}

.el-collapse-item__header {
  flex: 1 0 auto;
  order: -1;
}

.md > .el-icon-arrow-right:before {
  content: "\E60E";
}

.md {
  .ch-2 {
    margin-left: 10%;
    display: flex;
    border-bottom: 1px solid #e6ebf5;
    .el-checkbox {
      width: 74px;
    }
    .o-2-or {
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      font-size: 12px !important;
      .or-title {
        width: 15%;
        .el-checkbox__input {
          display: none !important;
        }
      }
      .or-child-item {
        width: 75%;
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        .or-child {
          width: 25%;
        }
      }
      .el-checkbox__label {
        padding-left: 3px;
        padding-right: 10px;
        font-size: 12px;
      }
    }
  }
}

.or-title > .el-checkbox__inner {
  display: none;
}

.or-title > .el-checkbox__input {
  display: none;
}

.or-title > .el-checkbox__label {
  font-size: 12px !important;
}

.md > .el-checkbox__label {
  font-size: 12px !important;
  padding-left: 2px;
  padding-right: 10px;
}

.el-collapse-item__header.is-active {
  border-bottom: 1px solid #e6ebf5;
}

.el-checkbox-group {
  width: 100%;
}
